window.swagPath=function(e){for(var n=[];e.parentNode;){if(e.id){n.unshift("#"+e.id);break}if(e==e.ownerDocument.documentElement)n.unshift(e.tagName);else{for(var i=1,t=e;t.previousElementSibling;t=t.previousElementSibling,i++);n.unshift(e.tagName+":nth-child("+i+")")}e=e.parentNode}return n.join(" > ")};